about:
  name: willbe
  description: Utility to manage modules of complex modular systems
  enabled: 1
  version: 0.3.166
  values:
    enabled: 1
    name: willbe
    interpreters:
      - nodejs >= 6.0.0
      - chrome >= 60.0.0
      - firefox >= 60.0.0
    keywords:
      - wTools
path:
  in:
    path: ..
  temp:
    path: out
  out:
    path: out
  out.debug:
    path: ./out/debug
    criterion:
      debug: 1
  out.release:
    path: ./out/release
    criterion:
      debug: 0
  doc:
    path: ./doc
  proto:
    path: ./proto
  repository:
    path: 'git+https:///github.com/Wandalen/willbe.git'
  bugs:
    path: 'https:///github.com/Wandalen/willbe/issues'
  exportedDir.proto.export:
    path: ./proto
    criterion:
      default: 1
      debug: 1
      raw: 1
      proto: 1
      doc: 0
      export: 1
      tar: 1
      public: 1
